import { useEffect,useState } from "react";
import API from "./api/axios";

function App() {
  const [msg,setMsg] = useState("");

  useEffect(()=>{
    API.get("/test").then((res)=>{
      setMsg(res.data.message);
    });
  },[]);

  return (
    <h1>{msg}</h1>
  );
}

export default App;
